''' downloading other files 
example an csv files
'''

from urllib import request

goog_url = "http://samplecsvs.s3.amazonaws.com/Sacramentorealestatetransactions.csv"

def download_a_csv_file(csv_url):
    response = request.urlopen(csv_url)
    csv = response.read()
    csv_str = str(csv)
    lines = csv_str.split("\\n")
    dest_url = r'goog.csv'
    fx = open(dest_url, "w")
    for line in lines:
        fx.write(line + "\n")
    fx.close()    

download_a_csv_file(goog_url)














